import React from 'react';
import styled from 'styled-components';
import {FlexWrapper} from '../../../components/FlexWrapper';
import photoDesktop from '../../../assets/1B7A6229.webp';
import line from '../../../assets/2931142_minimize_minus_remove_line_icon.svg';

export const Main = () => {
    return (
        <StyledMain>
            <FlexWrapper justify={'space-between'} align={'center'}>
                <MainContent>
                    <h1>Ваш личный психолог</h1>
                    <h2>Olga Tarasova<span><img src={"line"}/> </span></h2>
                </MainContent>
                <PhotoWrapper>
                    <Photo src={photoDesktop} alt={''}/>
                </PhotoWrapper>
            </FlexWrapper>
        </StyledMain>
    )
};


const StyledMain = styled.section`
    width: 80%;
    margin: auto;
    min-height: 90vh;
    height: fit-content;
`;
const MainContent = styled.div`
text-align: center`;
const PhotoWrapper = styled.div`
    position: relative;
    z-index: 0;

    &::before {
        content: "";
        width: 350px;
        height: 520px;
        border: 2px solid #dcb8d0;
        position: absolute;
        top: -20px;
        left: 20px;
        z-index: -1;

    }
`;
const Photo = styled.img`
    width: 350px;
    height: auto;
    object-fit: cover;

`;
